Fall I always miss you. 
•
Some food for thought. Each person has their preferences for little details that typically would not even be covered or questioned at a venue without a planner. The venue will do what they customarily do and can you blame them? They have super high volume and smaller details may not occur to a couple. 
•
For instance, you may want or be okay with all forks and knives being down at the start, including the dessert fork and spoon at the top of the plate. You may want a b and b place too, while others prefer less crowding. Make a choice about everything or those setting up the I’ll make the choices for you. 
